Step-by-step reasoning:
1. Key psychological mechanisms considered include self-interest and fairness. The responder cares about the amount of money they will receive, but they also compare that monetary offer to a fairness benchmark based on their relative token contribution.
2. The fairness benchmark (fair_share) is computed as the participant’s proportional contribution times the total combined earning. To introduce diminishing sensitivity to differences between the actual offer and the fair share, a concave (square-root) transformation is applied.
3. The square-root function captures diminishing returns such that increases in an already large amount matter less than equivalent increases when the amounts are small.
4. Two learnable parameters will be used: 
  • A self-interest parameter (gamma) that scales the monetary reward.
  • A fairness sensitivity parameter (delta) that modulates the impact of the difference between the square roots of the offered share and fair share.
5. The model maps the observable variables (split_self, token_self, token_opp, combined_earning) onto the computed utility for acceptance (U_accept). When the offered money exceeds the fairness benchmark (after transformation), the fairness term contributes positively if delta is positive, and vice versa.

The formal specification follows:

<MODEL>
Let fair_share = (token_self / (token_self + token_opp)) × combined_earning. 
Then, the utility for accepting an offer is given by:
  U_accept = gamma × split_self + delta × (√(split_self) − √(fair_share)).
</MODEL>

